import React, { useContext } from "react";
import { StateContext } from "./context";
import "./Order.css";

function Order() {
  const { orders } = useContext(StateContext);
  return (
    <div>
      {orders.length ? (
        orders.map((order) => (
          <form>
            <fieldset>
              <legend>Order</legend>
              <label for="date">Date</label>
              <input type="date" id="date" name="date"></input>
              <br></br>

              <label for="dish"></label>
              <input name="dish" type="text">
                <h1 className="orderTitle">{order}</h1>
              </input>
              <input type="submit" value="Submit"></input>
            </fieldset>
          </form>
        ))
      ) : (
        <h1 className="emptyOrder">No orders</h1>
      )}
    </div>
  );
}
export default Order;
